import React from "react";
import { useSelector } from "react-redux";
import "./App.css";
import { selectUser } from "./features/userSlice";
import Imessage from "./Imessage";
import Login from "./Login";

function App() {
  const user = useSelector(selectUser);

  return (
    <div className="app">
      {user ? <Imessage /> : <Login />}
    </div>
  );
}

export default App;
